import React, { Component } from 'react';
import styled from 'styled-components'

const Head = styled.h1`
  margin-bottom: 3%;
  margin-top: 10%;
  font-size: 55px;
  font-weight: bold;
  line-height: 1.35;
  color: #69302c;
`

const Sub = styled.p`
  font-size: 24px;
  font-weight: 500;
  color: #69302c;
`
const SubText = styled.div`
  font-size: 21px;
  cursor: pointer;
  color: #69302c;
  margin: 0px;
  &:hover {
    color: #69302c;
  }
`
const Button = styled.button`
    cursor: pointer;
    background-color:#69302c;
    border:0px solid transparent;
    border-radius: 3px;
    color: #fff;
    padding: 0.4em 1.25em;
    font-size: 21px;
    width: auto;
`
class App extends Component {
    render() {
        return (
            <div class="container">
                <div class="row">
                    <div class="col">
          <Head>
            ถ้าพูดเยอะอาจจะเจ็บคอ<br />
            แต่ถ้ามา Talk n' Chip 2019<br />
            แล้วพูดไม่พอจะเสียใจ
          </Head>
          <Sub>23 กุมพาพันธ์ 2019 ณ มหาวิทยาลัยเทคโนโลยีพระจอมเกล้าธนบุรี อาคารเรียนรวม 2 ชั้น 4 ห้อง 2401 และ 2402</Sub>
        </div>
      </div>
      <div class="row">
        <div class="col">
            <Button block>ส่งหัวข้อที่จะไปพูดกันเลย !</Button>
        </div>
        </div>
        <div class="col py-2 mt-1 my-0 pl-1" xs='12' md='7' lg='9'>
          <SubText>
            <span className='mx-3'>หรือ</span>
            <a href="#">ดูหัวข้อที่น่าสนใจ></a>
          </SubText>
        </div>
      </div>
                    );
                  }
                }
export default App
